import React, {useState, useEffect } from 'react';

import { getArray } from '../../api/api';

const Dashboard = () => {

    interface IDashboard {
        firstName: string;
        lastname: string;
    }

    const [chiropractorDetails, setchiropractorDetails] = useState<any[]>([])

    useEffect(() => {
        setchiropractorDetails(getArray());
    }, [])

    console.log(chiropractorDetails);

    return (
        <>
            {chiropractorDetails}
        </>    
    )
}

export default Dashboard;
